import React from 'react'

const Register = ({userData, handleValue, registerUser}) => {

  const regButton = document.getElementById('register-btn')



  return (
    <div className=" flex flex-col items-center h-screen justify-center">
    <h1 className='mb-24 text-6xl text-[#FFFFFF] font-extrabold'>livegab</h1>
    <input
      name="username"
      className=" w-[30%] h-[5%] border rounded bg-[#282A3A] border-[#7d94b5] text-center mb-4"
      placeholder="Enter your user name"
      value={userData.username}
      onChange={handleValue}
    />

    <button 
    id='register-btn'
    type="button"
    onMouseDown={registerUser} 
    className="w-[30%] h-[5%] cursor:pointer bg-[#007acc] text-white rounded hover:bg-[#2790d5]">
      Join
    </button>
  </div>
  )
}

export default Register
